def lithoComposition = LITHO_D
def lithoStrat = LITSTRAT

if (lithoComposition) {
	def combinedKey = lithoComposition + lithoStrat
	return ("#GeologicUnit_Litho_" +
  		UUID.nameUUIDFromBytes(combinedKey.getBytes()).toString());
}
else {
	return ("#GeologicUnit_LitStrat_" +
  		UUID.nameUUIDFromBytes(lithoStrat.getBytes()).toString());
}
